ype":"Div"},{"attributes":{"style":{"font-family":"Georgia, serif","font-size":"200%","width":"1500px"},"text":"\n         &lt;div&gt;\n         The Fourier transform is a method of decomposing a function that depends on space or time into\n         a function depending on spatial of temporal frequency.  For example you can use a Fourier transform\n         on an audio signal that varies in amplitude over time to determine the frequencies the audio signal\n         is composed of. The transform is defined by the following equation:\n             &lt;/div&gt;\n         "},"id":"1178","type":"Div"},{"attributes":{"coordinates":null,"data_source":{"id":"1003"},"glyph":{"id":"1123"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1125"},"nonselection_glyph":{"id":"1124"},"view":{"id":"1127"}},"id":"1126","type":"GlyphRenderer"},{"attributes":{"style":{"font-family":"Georgia, serif","font-size":"200%","width":"1500px"},"text":"\n         &lt;div&gt;\n         We then do a discrete Fourier transform and plot the values against the Fourier frequencies.  We can see two peaks in the series at 0.25 and 0.5 Hz which\n         correspond to the two frequencies that make up the signal.  It's important to note that the plot only includes half the values since the full plot is symmetrical about 0.\n         &lt;/div&gt;\n         "},"id":"1185","type":"Div"},{"attributes":{"below":[{"id":"1140"}],"center":[{"id":"1143"},{"id":"1147"}],"left":[{"id":"1144"}],"renderers":[{"id":"1166"},{"id":"1172"}],"title":{"id":"1130"},"toolbar":{"id":"1155"},"width":1500,"x_range":{"id":"1132"},"x_scale":{"id":"1136"},"y_range":{"id":"1134"},"y_scale":{"id":"1138"}},"id":"1129","subtype":"Figure","type":"Plot"},{"attributes":{"style":{"font-size":"200%","text-align":"center","width":"1500px"},"text":"\n          &lt;math&gt;\n          &lt;mover&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mo&gt;&amp;Hat;&lt;/mo&gt;&lt;/mover&gt; (&amp;xi;) =\n          &lt;msubsup&gt;&lt;mo&gt;&amp;Integral;&lt;/mo&gt;&lt;mn&gt;-&amp;infin;&lt;/mn&gt;&lt;mo&gt;&amp;infin;&lt;/mo&gt;&lt;/msubsup&gt; f(x) &lt;msup&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mo&gt;-2&amp;pi;ix&amp;xi;&lt;/mo&gt;&lt;/msup&gt; &lt;mi&gt;dx,  (Eq. 1)&lt;/mi&gt;\n          _______________________________________________________________________________________________________________________________________________________\n          &lt;/math&gt;\n         "},"id":"1179","type":"Div"},{"attributes":{"line_alpha":0.2,"line_color":"green","x":{"field":"t"},"y":{"field":"x3"}},"id":"1125","type":"Line"},{"attributes":{"style":{"font-family":"Georgia, serif","font-size":"200%","width":"1500px"},"text":"\n             &lt;header&gt; Discrete Fourier Transform &lt;/header&gt;\n             "},"id":"1180","type":"Div"},{"attributes":{"source":{"id":"1003"}},"id":"1127","type":"CDSView"},{"attributes":{},"id":"1095","type":"BasicTicker"},{"attributes":{"axis_label":"Intensity","coordinates":null,"formatter":{"id":"1215"},"group":null,"major_label_policy":{"id":"1216"},"ticker":{"id":"1145"}},"id":"1144","type":"LinearAxis"},{"attributes":{"below":[{"id":"1015"}],"center":[{"id":"1018"},{"id":"1022"}],"left":[{"id":"1019"}],"renderers":[{"id":"1041"}],"title":{"id":"1005"},"toolbar":{"id":"1030"},"width":1500,"x_range":{"id":"1007"},"x_scale":{"id":"1011"},"y_range":{"id":"1009"},"y_scale":{"id":"1013"}},"id":"1004","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1136","type":"LinearScale"},{"attributes":{"style":{"font-family":"Georgia, serif","font-size":"200%","width":"1500px"},"text":"\n         &lt;div&gt;The discrete Fourier transform is a version of the Fourier transform that takes a finite number\n         of equally spaced samples of a time dependant function and returns a finite set of equally spaced\n         samples of the frequency dependent discrete-time Fourier transform which is a continuous function.\n\n         In summary the discrete Fourier tranform takes a time dependent series of N complex numbers\n         &lt;math&gt;{&lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt;} = &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;/msub&gt;, &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;, ..., &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;N-1&lt;/mn&gt;&lt;/msub&gt; &lt;/math&gt; and returns\n         a frequency dependent series of N complex numbers &lt;math&gt;{&lt;msub&gt;&lt;mi&gt;X&lt;/mi&gt;&lt;mn&gt;k&lt;/mn&gt;&lt;/msub&gt;} = &lt;msub&gt;&lt;mi&gt;X&lt;/mi&gt;&lt;mn&gt;0&lt;/mn&gt;&lt;/msub&gt;,\n         &lt;msub&gt;X&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;, ..., &lt;msub&gt;&lt;mi&gt;X&lt;/mi&gt;&lt;mn&gt;N-1&lt;/mn&gt;&lt;/msub&gt; &lt;/math&gt;\n         as defined by the following equation:\n         &lt;/div&gt;\n         "},"id":"1181","type":"Div"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"f"},"y":{"field":"x1_FFT"}},"id":"1079","type":"Line"},{"attributes":{"coordinates":null,"group":null,"text":"Fourier transform of x2 and x3"},"id":"1130","type":"Title"},{"attributes":{},"id":"1016","type":"BasicTicker"},{"attributes":{},"id":"1013","type":"LinearScale"},{"attributes":{"args":{"N_slider":{"id":"1174"},"f2":0.24750000000000003,"f3":12.6225,"f_N":[[0.0,0.02475,0.0495,0.07425000000000001,0.099,0.12375,0.14850000000000002,0.17325000000000002,0.198,0.22275,0.2475,0.27225,0.29700000000000004,0.32175000000000004,0.34650000000000003,0.37125,0.396,0.42075,0.4455,0.47025,0.495,0.51975,0.5445,0.56925,0.5940000000000001,0.61875,0.6435000000000001,0.66825,0.6930000000000001,0.71775,0.7425,0.76725,0.792,0.8167500000000001,0.8415,0.8662500000000001,0.891,0.9157500000000001,0.9405,0.96525,0.99,1.01475,1.0395,1.0642500000000001,1.089,1.11375,1.1385,1.1632500000000001,1.1880000000000002,1.21275],[0.0,0.02477272727272727,0.04954545454545454,0.07431818181818181,0.09909090909090908,0.12386363636363634,0.14863636363636362,0.17340909090909087,0.19818181818181815,0.22295454545454543,0.247727 n                                arr.push(startValue + (step * i));\n                                }\n                        return arr;\n                    }\n\n                    data['x2'] = x2;\n                    data['x3'] = x3;\n                    data['t'] = t;\n\n                    source.change.emit();\n\n                    data_FFT['f'] = f_N[((N/10)-10)];\n                    data_FFT['x2_FFT'] = x2_FFT_N[((N/10)-10)];\n                    data_FFT['x3_FFT'] = x3_FFT_N[((N/10)-10)];\n\n                    source_FFT.change.emit();\n                    "},"id":"1175","type":"CustomJS"},{"attributes":{"style":{"font-size":"200%","text-align":"center","width":"1500px"},"text":"\n          &lt;math&gt;\n          X(&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt;) =\n          &lt;msubsup&gt;&lt;mo&gt;&amp;sum;&lt;/mo&gt;&lt;mn&gt;k&lt;/mn&gt;&lt;mo&gt;N&lt;/mo&gt;&lt;/msubsup&gt; &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;t&lt;/mn&gt;&lt;/msub&gt; &lt;msup&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mo&gt;-2&amp;pi;i(fn)k&amp;Delta;t&lt;/mo&gt;&lt;/msup&gt; &lt;mi&gt;,  (Eq. 2)&lt;/mi&gt;\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          where &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt; are the so called Fourier frequencies and are defined by\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt; = &lt;mfrac&gt; &lt;mi&gt;n&lt;/mi&gt; &lt;mi&gt;N&amp;Delta;t&lt;/mi&gt; &lt;/mfrac&gt;&lt;mi&gt;, (Eq. 3)&lt;/mi&gt;\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          which means Eq. 2 can be simplified to\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          X(&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt;) =\n          &lt;msubsup&gt;&lt;mo&gt;&amp;sum;&lt;/mo&gt;&lt;mn&gt;k&lt;/mn&gt;&lt;mo&gt;N&lt;/mo&gt;&lt;/msubsup&gt; &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;t&lt;/mn&gt;&lt;/msub&gt; &lt;msup&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mo&gt;-2&amp;pi;ink/N&lt;/msup&gt;&lt;mi&gt;,  (Eq. 4)&lt;/mi&gt;\n          &lt;/math&gt;\n         "},"id":"1182","type":"Div"},{"attributes":{},"id":"1132","type":"DataRange1d"},{"attributes":{"coordinates":null,"data_source":{"id":"1128"},"glyph":{"id":"1163"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1165"},"nonselection_glyph":{"id":"1164"},"view":{"id":"1167"}},"id":"1166","type":"GlyphRenderer"},{"attributes":{},"id":"1090","type":"LinearScale"},{"attributes":{},"id":"1007","type":"DataRange1d"},{"attributes":{"axis_label":"Time in seconds","coordinates":null,"formatter":{"id":"1200"},"group":null,"major_label_policy":{"id":"1201"},"ticker":{"id":"1016"}},"id":"1015","type":"LinearAxis"},{"attributes":{},"id":"1134","type":"DataRange1d"},{"attributes":{"style":{"font-size":"200%","text-align":"center","width":"1500px"},"text":"\n         &lt;math&gt;\n         For the following plot we take N=100 measurements over a 40 second period of the following time series function\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;(t) = sin(2&amp;pi;&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;) + 0.3sin(2&amp;pi;&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt;) + random noise, where\n         &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 0.5 Hz and &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 0.25 Hz\n         &lt;/math&gt;\n         "},"id":"1184","type":"Div"},{"attributes":{"axis_label":"Signal amplitude","coordinates":null,"formatter":{"id":"1209"},"group":null,"major_label_policy":{"id":"1210"},"ticker":{"id":"1099"}},"id":"1098","type":"LinearAxis"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"fi n         &lt;math&gt;\n         For the following plot we take N=100 measurements over a 40 second period of the following time series functions\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt;(t) = sin(2&amp;pi;&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt;) + random noise, where\n         &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 0.25 Hz\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msub&gt;(t) = sin(2&amp;pi;&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;) + random noise, where\n         &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;3&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 12.62 Hz\n         &lt;/math&gt;\n         "},"id":"1188","type":"Div"},{"attributes":{"coordinates":null,"data_source":{"id":"1003"},"glyph":{"id":"1117"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1119"},"nonselection_glyph":{"id":"1118"},"view":{"id":"1121"}},"id":"1120","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"group":null,"text":"Signals x2 and x3 over time"},"id":"1084","type":"Title"},{"attributes":{"style":{"font-family":"Georgia, serif","font-size":"200%","width":"1500px"},"text":"\n         &lt;div&gt;\n         At first glance the signals look identical, like they have the same frequency.  Using the slider to increase N you'll notice that x3 and it's frequency change though while x2 doesn't.\n         This is because x3 is being undersampled while x2 isn't.  As you increase the sampling rate the 'measured' frequency will bounce around until you reach approximately 1010.  After that\n         no matter how much you increase the number of samples both frequencies with remain the same.  This because we've reached what is called the Nyquist rate, named after Harry Nyquist.\n         &lt;/div&gt;\n         &lt;br&gt;\n         "},"id":"1189","type":"Div"},{"attributes":{},"id":"1088","type":"DataRange1d"},{"attributes":{},"id":"1226","type":"UnionRenderers"},{"attributes":{"overlay":{"id":"1108"}},"id":"1104","type":"BoxZoomTool"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1154","type":"BoxAnnotation"},{"attributes":{"style":{"font-size":"200%","text-align":"center","width":"1500px"},"text":"\n         &lt;math&gt;\n         The Nyquist rate is defined by the following equation\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         &lt;msub&gt;&lt;mi&gt;&amp;rho;&lt;/mi&gt;&lt;mn&gt;NYQUIST&lt;/mn&gt;&lt;/msub&gt; = 2&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;max&lt;/mn&gt;&lt;/msub&gt; (Eq. 4)\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         where &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;max&lt;/mn&gt;&lt;/msub&gt; is the highest frequency in the signal being measured.\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         So in our case we know that the maximum frequency of our signal is 12.62 Hz therefore the Nyquist rate will be 25.24 Hz.\n         From that we can determine the required minimum number of samples, &lt;msub&gt;&lt;mi&gt;N&lt;/mi&gt;&lt;mn&gt;min&lt;/mn&gt;&lt;/msub&gt;, required using\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         &lt;msub&gt;&lt;mi&gt;N&lt;/mi&gt;&lt;mn&gt;min&lt;/mn&gt;&lt;/msub&gt; = &lt;msub&gt;&lt;mi&gt;&amp;rho;&lt;/mi&gt;&lt;mn&gt;NYQUIST&lt;/mn&gt;&lt;/msub&gt;T (Eq. 5)\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         where T is our measurement period of 40 seconds which means  &lt;msub&gt;&lt;mi&gt;N&lt;/mi&gt;&lt;mn&gt;min&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 1010 measurements.\n         &lt;/math&gt;\n         "},"id":"1190","type":"Div"},{"attributes":{"axis":{"id":"1094"},"coordinates":null,"group":null,"ticker":null},"id":"1097","type":"Grid"},{"attributes":{},"id":"1092","type":"LinearScale"},{"attributes":{"axis":{"id":"1144"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1147","type":"Grid"},{"attributes":{},"id":"1227","type":"Selection"},{"attributes":{"children":[{"id":"1176"},{"id":"1177"},{"id":"1178"},{"id":"1179"},{"id":"1180"},{"id":"1181"},{"id":"1182"},{"id":"1184"},{"id":"1004"},{"id":"1185"},{"id":"1044"},{"id":"1186"},{"id":"1187"},{"id":"1188"},{"id":"1083"},{"id":"1174"},{"id":"1129"},{"id":"1189"},{"id":"1190"}]},"id":"1191","type":"Column"},{"attributes":{"axis_label":"Time in seconds","coordinates":null,"formatter":{"id":"1212"},"group":null,"major_label_policy":{"id":"1213"},"ticker":{"id":"1095"}},"id":"1094","type":"LinearAxis"},{"attributes":{},"id":"1145","type":"BasicTicker"},{"attributes":{},"id":"1106","type":"ResetTool"},{"attributes":{},"id":"1149","type":"WheelZoomTool"},{"attributes":{},"id":"1148","type":"PanTool"},{"attributes":{},"id":"1105","type":"SaveTool"},{"attributes":{"overlay":{"id":"1154"}},"id":"1150","type":"BoxZoomTool"},{"attributes":{"axis":{"id":"1098"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1101","type":"Grid"},{"attributes":{},"id":"1151","type":"SaveTool"},{"attributes":{},"id":"1099","type":"BasicTicker"},{"attributes":{},"id":"1152","type":"ResetTool"},{"attributes":{},"id":"1107","type":"HelpTool"},{"attributes":{},"id":"1103","type":"WheelZoomTool"},{"attributes":{},"id":"1102","type":"PanTool"}],"root_ids":["1191"]},"title":"Bokeh Application","version":"2.4.2"}}
